import React, { useState } from 'react';

const AuthLogin = ({ onLoginSuccess }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [isRegistering, setIsRegistering] = useState(false);
  const [email, setEmail] = useState('');

  const handleLogin = () => {
    setError('');
    if (username === 'user' && password === 'password') {
      onLoginSuccess(username);
    } else {
      setError('Usuario o contraseña incorrectos, ¡échale ganas!');
    }
  };

  const handleGmailRegister = () => {
    alert('¡Imagina que te registraste con Gmail! ¡Bienvenido a ONIX!');
    onLoginSuccess(email || 'Usuario Gmail');
  };

  const handleRegister = () => {
    alert('¡Imagina que te registraste con tu correo! ¡Bienvenido a ONIX!');
    onLoginSuccess(email || 'Nuevo Usuario');
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-black p-4">
      <div className="relative bg-gradient-to-br from-gray-900 to-gray-800 p-8 rounded-2xl shadow-2xl w-full max-w-md transform transition-all duration-500 hover:scale-105 overflow-hidden border border-gray-700">
        {/* Efecto de estrellas */}
        <div className="absolute inset-0 z-0 opacity-30">
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '10%', left: '20%', animationDelay: '0s' }}></div>
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '30%', left: '70%', animationDelay: '0.5s' }}></div>
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '60%', left: '40%', animationDelay: '1s' }}></div>
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '80%', left: '10%', animationDelay: '1.5s' }}></div>
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '20%', left: '90%', animationDelay: '2s' }}></div>
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '50%', left: '5%', animationDelay: '2.5s' }}></div>
          <div className="absolute w-1 h-1 bg-white rounded-full animate-pulse" style={{ top: '70%', left: '80%', animationDelay: '3s' }}></div>
        </div>

        <div className="relative z-10">
          <h2 className="text-4xl font-extrabold text-center text-white mb-8">¡BIENVENIDO A ONIX!</h2>
          {!isRegistering ? (
            <>
              <input
                type="text"
                placeholder="Usuario"
                className="w-full px-5 py-3 mb-4 border border-gray-600 bg-gray-700 text-white rounded-xl focus:outline-none focus:ring-3 focus:ring-indigo-500 transition-all duration-300 text-lg placeholder-gray-400"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
              <input
                type="password"
                placeholder="Contraseña"
                className="w-full px-5 py-3 mb-6 border border-gray-600 bg-gray-700 text-white rounded-xl focus:outline-none focus:ring-3 focus:ring-indigo-500 transition-all duration-300 text-lg placeholder-gray-400"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
              {error && <p className="text-red-400 text-center mb-4 text-sm font-medium">{error}</p>}
              <button
                onClick={handleLogin}
                className="w-full bg-indigo-600 text-white py-3 rounded-xl text-xl font-bold hover:bg-indigo-700 transition-all duration-300 transform hover:scale-105 shadow-lg mb-4"
              >
                Entrar
              </button>
              <p className="text-center text-gray-400 mt-6 text-md">
                ¿No tienes cuenta?{' '}
                <button onClick={() => setIsRegistering(true)} className="text-indigo-400 hover:underline font-semibold">
                  ¡Regístrate aquí!
                </button>
              </p>
            </>
          ) : (
            <>
              <input
                type="email"
                placeholder="Correo electrónico"
                className="w-full px-5 py-3 mb-4 border border-gray-600 bg-gray-700 text-white rounded-xl focus:outline-none focus:ring-3 focus:ring-indigo-500 transition-all duration-300 text-lg placeholder-gray-400"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
              <button
                onClick={handleRegister}
                className="w-full bg-green-600 text-white py-3 rounded-xl text-xl font-bold hover:bg-green-700 transition-all duration-300 transform hover:scale-105 shadow-lg mb-4"
              >
                Registrarse con Correo
              </button>
              <button
                onClick={handleGmailRegister}
                className="w-full bg-red-500 text-white py-3 rounded-xl text-xl font-bold hover:bg-red-600 transition-all duration-300 transform hover:scale-105 shadow-lg flex items-center justify-center space-x-2"
              >
                <svg className="w-6 h-6" fill="currentColor" viewBox="0 0 24 24">
                  <path d="M22.675 11.625c0-.78-.068-1.535-.195-2.26H12v4.51h6.59c-.313 1.62-1.25 2.99-2.75 3.92v3.56h2.91c1.705-1.57 2.69-3.88 2.69-6.63z" fill="#4285F4"></path>
                  <path d="M12 23c3.24 0 5.93-1.07 7.91-2.91l-2.91-3.56c-1.07.72-2.45 1.14-4.01 1.14-3.08 0-5.69-2.07-6.63-4.85H2.49v3.64C4.43 20.93 7.91 23 12 23z" fill="#34A853"></path>
                  <path d="M5.37 14.29c-.25-.72-.39-1.49-.39-2.29s.14-1.57.39-2.29V5.96H2.49C1.68 7.57 1.25 9.24 1.25 11s.43 3.43 1.24 5.04l2.91-2.75z" fill="#FBBC05"></path>
                  <path d="M12 4.75c1.77 0 3.35.61 4.6 1.8l2.59-2.59C17.93 1.07 15.24 0 12 0 7.91 0 4.43 2.07 2.49 5.96l2.91 2.75C6.31 6.82 8.92 4.75 12 4.75z" fill="#EA4335"></path>
                </svg>
                <span>Registrarse con Gmail</span>
              </button>
              <p className="text-center text-gray-400 mt-6 text-md">
                ¿Ya tienes cuenta?{' '}
                <button onClick={() => setIsRegistering(false)} className="text-indigo-400 hover:underline font-semibold">
                  ¡Inicia sesión!
                </button>
              </p>
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default AuthLogin;
